import React, { useState } from 'react';
import { MDBBtn,
  MDBModal,
  MDBModalDialog,
  MDBModalContent,
  MDBModalHeader,
  MDBModalTitle,
  MDBModalBody,
  MDBModalFooter,
  MDBInput,
} from 'mdb-react-ui-kit';

export default function AddNode() {
  const [AddNodeModal, setAddNodeModal] = useState(false);
  const [NodeIp, setNodeIp] = useState('')
  const [NodePort, setNodePort] = useState('')

  const toggleAddNodeModal = () => setAddNodeModal(!AddNodeModal);

  return (
    <>
    <MDBBtn onClick={toggleAddNodeModal}>Add Node</MDBBtn>
    <MDBModal show={AddNodeModal} getOpenState={(e: any) => setAddNodeModal(e)} tabIndex='-1'>
      <MDBModalDialog>
        <MDBModalContent>
          <MDBModalHeader>
            <MDBModalTitle>Add Node</MDBModalTitle>
            <MDBBtn className='btn-close' color='none' onClick={toggleAddNodeModal}></MDBBtn>
          </MDBModalHeader>
          <MDBModalBody>
              <form>
                <MDBInput label='Text input' id='typeText' type='text' />
              </form>
          </MDBModalBody>

          <MDBModalFooter>
            <MDBBtn color='danger' onClick={toggleAddNodeModal}>
              Close
            </MDBBtn>
            <MDBBtn>Save changes</MDBBtn>
          </MDBModalFooter>
        </MDBModalContent>
      </MDBModalDialog>
    </MDBModal>
    </>
  );
}
